import Layout from "antd/lib/layout/layout";
import Title from "antd/lib/skeleton/Title";
import React from "react";

export default class Homepage extends React.Component {

    render() {
        return <Layout>
            <Layout.Content>
                <Title>Homepage</Title>
            </Layout.Content>
        </Layout>
    }
}
